public int compareTo(Object other) {
  Class c1 = this.getClass();
  Class c2 = other.getClass();
  if (c1 != c2) {
    int c = c1.hashCode() - c2.hashCode();
    if (c == 0) {
      c = c1.getCanonicalName().compareTo(c2.getCanonicalName());
    }
    return c;
  }
  return compareSameType(other);
}

